  Hatteras Island shorelines from 1978 to 2002: fourteen high water shorelines from
  Oregon Inlet to Cape Hatteras Point, North Carolina (geographic, WGS84).\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 2,\n\t\t\"recent\": 2\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-02-10T06:16:33.522747\",\n\t\"name\": \"hatteras-shorelines-1978-2002-hatteras-island-shorelines-from-1978-to-2002-fourteen-high-water-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The shoreline of Cape Hatteras, North Carolina,
  is experiencing long-term coastal erosion. In order to better understand and monitor
  the changing coastline, historical aerial imagery is used to map shoreline change.
  For the area of Hatteras Island from Cape Point to Oregon Inlet, fourteen aerial
  datasets from 1978-2002 were scanned and georeferenced for use in a Geographic Information
  System (GIS). Shoreline positions (high water line) were digitized from georeferenced
  imagery. The shoreline vectors were then compiled for use in the Digital Shoreline
  Analysis System (DSAS) ArcGIS extension in order to generate rates of shoreline
  change.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
